function generateApiUrl(telegramLink) {
    const apiBase = "http://54.169.0.232:3000/api/message?";

    // Sử dụng regex để lấy phần peer và id cuối cùng
    const match = telegramLink.match(/t\.me\/([\w_]+)(?:\/\d+)*\/(\d+)/);
    if (!match) return "Invalid Telegram link";

    const peer = match[1];
    const id = match[2];

    // Tạo URL API hoàn chỉnh
    return `${apiBase}peer=${2}&id=${id}`;
}

